import { defer, from, Observable, of } from 'rxjs';
import { concatMap, delay, repeat, switchMap } from 'rxjs/operators';
import type { RawMqttMessage } from '@osf/gateway';

/**
 * Quality Check Fixtures for testing AIQS quality check image display
 * Contains quality_check topic messages with base64-encoded images
 */

export interface QualityCheckFixture {
  topic: string;
  payload: {
    num?: number;
    result?: 'PASSED' | 'FAILED';
    ts?: string;
    data?: string; // base64-encoded image data URL
  };
  timestamp: string;
}

// Real quality check payload from data/aps-data/topics/quality_check1/_j1_txt_1_i_quality_check__000012.json
// This contains a real base64-encoded PNG image from TXT_AIQS
const REAL_QUALITY_CHECK_PAYLOAD = {
  num: 2,
  result: 'PASSED' as const,
  ts: '2026-01-13T07:10:48.034404Z',
  data: `data:image/png;base64,`, // Full base64-encoded PNG image from TXT_AIQS
};

const QUALITY_CHECK_FIXTURES: QualityCheckFixture[] = [
  {
    topic: '/j1/txt/1/i/quality_check',
    payload: REAL_QUALITY_CHECK_PAYLOAD,
    timestamp: REAL_QUALITY_CHECK_PAYLOAD.ts,
  },
];

/**
 * Load Quality Check fixtures
 * @returns Array of RawMqttMessage objects
 */
export const loadQualityCheckFixtures = (): RawMqttMessage[] => {
  return QUALITY_CHECK_FIXTURES.map((fixture) => ({
    topic: fixture.topic,
    payload: JSON.stringify(fixture.payload),
    timestamp: fixture.timestamp,
    qos: 0,
    retain: false,
  }));
};

/**
 * Create an Observable stream of Quality Check fixture messages
 * @param options - Stream options (interval, loop)
 * @returns Observable stream of RawMqttMessage objects
 */
export const createQualityCheckFixtureStream = (
  options?: { intervalMs?: number; loop?: boolean }
): Observable<RawMqttMessage> => {
  const messages = loadQualityCheckFixtures();
  return defer(() => from(messages)).pipe(
    switchMap((message) => {
      const delayMs = options?.intervalMs ?? 0;
      if (delayMs > 0) {
        return from([message]).pipe(concatMap((msg) => of(msg).pipe(delay(delayMs))));
      }
      return of(message);
    }),
    options?.loop ? repeat() : (source) => source
  );
};
